import React from "react";
import { Carousel, Image } from "react-bootstrap/";
import "bootstrap/dist/css/bootstrap.min.css";

function Dard() {
  return (
    <div>
      <Carousel.Item style={{ width: "100%", height: "150px" }}>
        <img
          className="d-block active w-100"
          src="/image/1.jpg"
          style={{ height: "150px" }}
        />
      </Carousel.Item>
      <Carousel.Item style={{ width: "100%", height: "150px" }}>
        <img
          className="d-block active w-100"
          src="/image/1.jpg"
          style={{ height: "150px" }}
        />
      </Carousel.Item>
      <Carousel.Item style={{ width: "100%", height: "150px" }}>
        <img
          className="d-block active w-100"
          src="/image/1.jpg"
          style={{ height: "150px" }}
        />
      </Carousel.Item>
    </div>
  );
}

function CommonBurger() {
  return (
    <Carousel>
      <Dard />
    </Carousel>
  );
}

export default CommonBurger;
